pragma solidity 0.4.24;

import './StoreContract.sol';

contract ProxyLike {
    address public CnStaking;
    address public Delegation;
    function setDelegation(address) external;

    function getRewardStat() external view returns (uint, uint, uint, uint);

    function stakeKlay() external payable;
    function staking() external view returns (uint);

    function submitApproveStakingWithdrawal(address, uint) external returns (uint, address, uint, uint, uint);
    function withdrawApprovedStaking(uint) external returns (uint);
}

contract SKlayLike {
    function _owner() public returns (address);
    function nextOwner(address) public;
    function changeOwner() public;

    function totalSupply() public view returns (uint);
    function transferFrom(address, address, uint) public returns (bool);

    function mint(address, uint) public;
    function burn(address, uint) public;
}

contract DelegationContract {
    string public constant version = "0723";

    event Deposit(address user, uint sklay);
    event Withdraw(address user, uint sklay);

    event Stake(address user, uint amount, uint sklay);
    event Unstake(address user, uint amount, uint sklay, uint due, uint uid);

    event SuccessClaim(address user, uint amount, uint uid);
    event FailClaim(address user, uint amount, uint sklay, uint uid);

    event UserStat(address user, uint deposit, uint pending, uint totalIn, uint totalOut);
    event PoolStat(uint totalSupply, uint staking);

    // --- Contracts & Auth ---
    ProxyLike public Proxy;
    SKlayLike public SKlay;
    StoreContract public Store;

    DelegationContract public newDelegation;

    enum State { Ready, Running, Killed }
    enum Action { Staking, Unstaking }
    enum UnstakingState { Unknown, Transferred, Canceled }

    State public state = State.Ready;

    modifier notStarted {
        require(state == State.Ready);
        _;
    }

    modifier notPaused {
        require(state == State.Running);
        _;
    }

    constructor(address _proxy, address _sklay, address _store) public {
		require(_proxy != address(0));
		require(_sklay != address(0));
		require(_store != address(0));

        Proxy = ProxyLike(_proxy);
        SKlay = SKlayLike(_sklay);
        Store = StoreContract(_store);
    }

    modifier onlyProxy {
        require(msg.sender == address(Proxy));
        _;
    }

    modifier onlyNewDelegation {
        require(msg.sender == address(newDelegation));
        _;
    }

    function startDelegation(address _delegation, address _init) public notStarted onlyProxy {
        state = State.Running;

        if (_delegation != address(0)) {
            require(_init == address(0));
            DelegationContract(_delegation).migrateDelegation();
        }

        Store.changeOwner();
        SKlay.changeOwner();

        require(Proxy.Delegation() == address(this));
        require(Store._owner() == address(this));
        require(SKlay._owner() == address(this));

        if (_init != address(0)) {
            require(_delegation == address(0));
            uint staking = Proxy.staking();
            SKlay.mint(address(Store), staking);
            _stake(Proxy.CnStaking(), _init, staking, staking);
        }
    }

    function nextDelegation(address _delegation) public onlyProxy {
        newDelegation = DelegationContract(_delegation);
    }

    function migrateDelegation() public notPaused onlyNewDelegation {
        state = State.Killed;

        Store.nextOwner(address(newDelegation));
        SKlay.nextOwner(address(newDelegation));
        Proxy.setDelegation(address(newDelegation));
    }

    function setProxy(address _proxy) public onlyProxy {
        Proxy = ProxyLike(_proxy);
    }

    function execute(address _to, uint _value, bytes memory _data) public onlyProxy {
        (bool result,) = _to.call.value(_value)(_data);
        if (!result) {
            revert();
        }
    }

    // --- Math ---
    function add(uint a, uint b) private pure returns (uint) {
        require(a <= uint(-1) - b);
        return a + b;
    }
    function sub(uint a, uint b) private pure returns (uint) {
        require(a >= b);
        return a - b;
    }

    function mul(uint a, uint b) private pure returns (uint) {
        require(b == 0 || a <= uint(-1) / b);
        return a * b;
    }

    function div(uint a, uint b) private pure returns (uint) {
        require(b != 0);
        return a / b;
    }

    function emitUserStat(address user) private {
        uint deposit = Store.deposit(user);
        uint pending = Store.pending(user);
        uint totalIn = Store.totalIn(user);
        uint totalOut = Store.totalOut(user);

        emit UserStat(user, deposit, pending, totalIn, totalOut);
    }

    function emitPoolStat() private {
        uint totalSupply = SKlay.totalSupply();
        (uint reward,,,) = Proxy.getRewardStat();
        uint staking = add(Proxy.staking(), reward);
        staking = sub(staking, Store.totalPending());

        emit PoolStat(totalSupply, staking);
    }

    // user --- (SKlay) ---> Store
    function depositSKlay(uint sklay) public notPaused {
        Proxy.stakeKlay();
        require(SKlay.transferFrom(msg.sender, address(Store), sklay));

        uint staking = sub(Proxy.staking(), Store.totalPending());
        uint klay = div(mul(sklay, staking), SKlay.totalSupply());

        _depositToken(msg.sender, sklay, klay);

        emit Deposit(msg.sender, sklay);
        emitUserStat(msg.sender);
        emitPoolStat();
    }

    // Store --- (SKlay) ---> user
    function withdrawSKlay(uint sklay) public notPaused {
        Proxy.stakeKlay();
        require(SKlay.transferFrom(address(Store), msg.sender, sklay));

        uint staking = sub(Proxy.staking(), Store.totalPending());
        uint klay = div(mul(sklay, staking), SKlay.totalSupply());

        _withdrawToken(msg.sender, sklay, klay);

        emit Withdraw(msg.sender, sklay);
        emitUserStat(msg.sender);
        emitPoolStat();
    }

    // Fallback: Klay 입금을 받지 않는다. (payable 아님)
    function() external { }

    // 사용자가 stake 요청
    // sender가 아닌 다른 이름으로 넣을 수 있어야 함
    function stakeKlay(address to) public notPaused payable {
        if (to == address(0)) {
            to = msg.sender;
        }

        uint klay = msg.value;  // 컨트랙트가 이미 value만큼 갖고 있음
        require(klay != 0);

        Proxy.stakeKlay();
        uint staking = sub(Proxy.staking(), Store.totalPending());

        uint sklay = klay;  // default value

        if (SKlay.totalSupply() != 0) {
            sklay = div(mul(klay, SKlay.totalSupply()), staking);
        }

        Proxy.stakeKlay.value(klay)();
        SKlay.mint(address(Store), sklay);

        _stake(Proxy.CnStaking(), to, klay, sklay);

        emit Stake(to, klay, sklay);
        emitUserStat(to);
        emitPoolStat();
    }

    // 사용자가 Unstaking 요청 (Klay 단위)
    // 서비스에서는 주로 이게 쓰일 것
    // sender가 아닌 다른 사람에게 돈이 갈 수 있어야 함
    function unstakeKlay(address to, uint klay) public notPaused {
        require(klay != 0);

        if (to == address(0)) {
            to = msg.sender;
        }

        Proxy.stakeKlay();
        uint staking = sub(Proxy.staking(), Store.totalPending());

        uint limitSKlay = Store.deposit(msg.sender);

        uint sklay = limitSKlay;  // default: maximum

        if (klay != uint(-1)) {
            sklay = div(mul(klay, SKlay.totalSupply()), staking);
        }

        require(sklay <= limitSKlay);

        klay = div(mul(sklay, staking), SKlay.totalSupply());

        require(klay != 0);

        // sender가 아니라 to에게로 돈이 가도록
        (uint uid, , , uint due, ) = Proxy.submitApproveStakingWithdrawal(to, klay);

        SKlay.burn(address(Store), sklay);

        _unstake(Proxy.CnStaking(), msg.sender, klay, sklay, due, uid);

        emit Unstake(msg.sender, klay, sklay, due, uid);
        emitUserStat(msg.sender);
        emitPoolStat();
    }

    // 사용자가 Unstaking 요청 (SKlay 단위)
    function unstakeKlayWithSKlay(address to, uint sklay) public notPaused {
        require(sklay != 0);

        if (to == address(0)) {
            to = msg.sender;
        }

        Proxy.stakeKlay();
        uint staking = sub(Proxy.staking(), Store.totalPending());

        uint limitSKlay = Store.deposit(msg.sender);

        if (sklay == uint(-1)) {
            sklay = limitSKlay;
        }

        require(sklay <= limitSKlay);

        uint klay = div(mul(sklay, staking), SKlay.totalSupply());

        require(klay != 0);

        (uint uid, , , uint due, ) = Proxy.submitApproveStakingWithdrawal(to, klay);

        SKlay.burn(address(Store), sklay);

        _unstake(Proxy.CnStaking(), msg.sender, klay, sklay, due, uid);

        emit Unstake(msg.sender, klay, sklay, due, uid);
        emitUserStat(msg.sender);
        emitPoolStat();
    }

    function claimUnstakingKlay(uint uid) public notPaused {
        UnstakingState result = UnstakingState(Proxy.withdrawApprovedStaking(uid));

        (address user, uint klay, , ,) = Store.getUnstakingList(Proxy.CnStaking(), uid);

        if (result == UnstakingState.Transferred) {
            _successClaim(Proxy.CnStaking(), uid);

            emit SuccessClaim(user, klay, uid);
        }
        else if (result == UnstakingState.Canceled) {
            Proxy.stakeKlay();
            uint staking = sub(Proxy.staking(), Store.totalPending());

            uint sklay = klay;

            if (SKlay.totalSupply() != 0) {
                sklay = div(mul(klay, SKlay.totalSupply()), staking);
            }

            SKlay.mint(address(Store), sklay);

            _failClaim(Proxy.CnStaking(), uid, sklay);

            emit FailClaim(user, klay, sklay, uid);
        }

        emitUserStat(user);
        emitPoolStat();
    }

    function refreshStaking() public notPaused {
        Proxy.stakeKlay();
        emitPoolStat();
    }

    function getUserStat(address user) public view returns (uint, uint, uint, uint) {
        uint deposit = Store.deposit(user);
        uint pending = Store.pending(user);
        uint totalIn = Store.totalIn(user);
        uint totalOut = Store.totalOut(user);

        return (deposit, pending, totalIn, totalOut);
    }

    function getPoolStat() public view returns (uint, uint) {
        uint totalSupply = SKlay.totalSupply();
        (uint reward,,,) = Proxy.getRewardStat();
        uint staking = add(Proxy.staking(), reward);
        staking = sub(staking, Store.totalPending());

        return (totalSupply, staking);
    }

    function getRewardStat() public view returns (uint reward, uint commission, uint commissionRate, uint commissionDecimal) {
        (reward, commission, commissionRate, commissionDecimal) = Proxy.getRewardStat();
    }

    function getCnStakingAddress() public view returns (address){
        return Proxy.CnStaking();
    }

    function _depositToken(address user, uint tokenAmount, uint amount) private {
        Store.setDeposit(user, add(Store.deposit(user), tokenAmount));
        Store.setSTotalIn(user, add(Store.sTotalIn(user), amount));
    }

    function _withdrawToken(address user, uint tokenAmount, uint amount) private {
        Store.setDeposit(user, sub(Store.deposit(user), tokenAmount));
        Store.setSTotalOut(user, add(Store.sTotalOut(user), amount));
    }

    function _stake(address cn, address user, uint amount, uint tokenAmount) private {
        uint idx = Store.historyCount(user);
        Store.setHistory(user, idx, uint(Action.Staking), cn, now, amount, uint(UnstakingState.Transferred), 0);

        Store.setDeposit(user, add(Store.deposit(user), tokenAmount));
        Store.setTotalIn(user, add(Store.totalIn(user), amount));

        uint sidx = Store.subHistoryCount(cn, user);
        Store.setSubHistory(cn, user, sidx, uint(Action.Staking), now, amount, uint(UnstakingState.Transferred), 0);

        Store.setHistoryCount(user, idx + 1);
        Store.setSubHistoryCount(cn, user, sidx + 1);
    }

    function _unstake(address cn, address user, uint amount, uint tokenAmount, uint due, uint uid) private {
        uint idx = Store.historyCount(user);
        Store.setHistory(user, idx, uint(Action.Unstaking), cn, now, amount, uint(UnstakingState.Unknown), due);
        Store.setUnstakingMap(cn, uid, user, idx);

        Store.setDeposit(user, sub(Store.deposit(user), tokenAmount));
        Store.setTotalOut(user, add(Store.totalOut(user), amount));

        Store.setPending(user, add(Store.pending(user), amount));
        Store.setTotalPending(add(Store.totalPending(), amount));

        uint sidx = Store.subHistoryCount(cn, user);
        Store.setSubHistory(cn, user, sidx, uint(Action.Unstaking), now, amount, uint(UnstakingState.Unknown), due);

        Store.setLastUid(cn, uid);
        Store.setUnstakingList(cn, uid, user, amount, due, uint(UnstakingState.Unknown), sidx);

        Store.setHistoryCount(user, idx + 1);
        Store.setSubHistoryCount(cn, user, sidx + 1);
    }

    function _successClaim(address cn, uint uid) private {
        (address ruser, uint ridx) = Store.getUnstakingMap(cn, uid);
        Store.setHistoryState(ruser, ridx, uint(UnstakingState.Transferred));

        (address uuser, uint amount, , , uint uidx) = Store.getUnstakingList(cn, uid);

        Store.setPending(uuser, sub(Store.pending(uuser), amount));
        Store.setTotalPending(sub(Store.totalPending(), amount));

        Store.setUnstakingListState(cn, uid, uint(UnstakingState.Transferred));
        Store.setSubHistoryState(cn, uuser, uidx, uint(UnstakingState.Transferred));
    }

    function _failClaim(address cn, uint uid, uint tokenAmount) private {
        (address ruser, uint ridx) = Store.getUnstakingMap(cn, uid);
        Store.setHistoryState(ruser, ridx, uint(UnstakingState.Canceled));

        (address uuser, uint amount, , , uint uidx) = Store.getUnstakingList(cn, uid);

        Store.setDeposit(uuser, add(Store.deposit(uuser), tokenAmount));
        Store.setTotalOut(uuser, sub(Store.totalOut(uuser), amount));

        Store.setPending(uuser, sub(Store.pending(uuser), amount));
        Store.setTotalPending(sub(Store.totalPending(), amount));

        Store.setUnstakingListState(cn, uid, uint(UnstakingState.Canceled));
        Store.setSubHistoryState(cn, uuser, uidx, uint(UnstakingState.Canceled));
    }
}
